const weatherData = [
    {
        
        conditions:"sunny",
         time: "day",
    },
    {
      
        conditions:"clear",
        time: "day",
      
    },
    {
       
        conditions:"clear",
         time:"day",
    },
    {
        
        conditions: "partly sunny",
        time: "night",
    },
    {
        conditions: "clear",
        time:"day",
    }
]

export default weatherData;
